import React, { useEffect, useState } from "react";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  // MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBFormInline,
} from "mdbreact";

import { BrowserRouter as Router } from "react-router-dom";

function NavbarComponent() {
  const [isOpen, setIsOpen] = useState(false);
  const [supportsPWA, setSupportsPWA] = useState(false);
  const [promptInstall, setPromptInstall] = useState(null);

  const toggleCollapse = () => {
    setIsOpen(!isOpen);
    // this.setState({ isOpen: !this.state.isOpen });
  };

  const iconStyle = {
    paddingTop: "0px",
    backgroundColor: "#ffffff",
    height: "70px",
    width: "70px",
    borderRadius: "50%",
    display: "inline-block",
    fontSize: "9px",
    textAlign: "center",
  };

  useEffect(() => {
    const handler = (e) => {
      e.preventDefault();
      console.log("we are being triggered :D");
      setSupportsPWA(true);
      setPromptInstall(e);
    };
    window.addEventListener("beforeinstallprompt", handler);

    return () => window.removeEventListener("transitionend", handler);
  }, []);

  const installPWA = (evt) => {
    evt.preventDefault();
    if (!promptInstall) {
      alert("Not supported")
      return;
    }
    alert("supported")
    promptInstall.prompt();
  };


  return (
    <React.Fragment>
      <Router>
        <MDBNavbar style={{ backgroundColor: "#b5cdd9" }} dark expand="md">
          <MDBNavbarBrand>
            <a href="/">

            <img
              src="/images/others/StSt_logo.png"
              className="img-fluid"
              alt="logo"
              style={{ width: "80px" }}
            />
            </a>
          </MDBNavbarBrand>
          <MDBNavbarToggler onClick={toggleCollapse} />
          <MDBCollapse id="navbarCollapse3" isOpen={isOpen} navbar>
            {/* <MDBNavbarNav center>
              <MDBNavItem active>
                <MDBNavLink
                  to="#!"
                  className="text-uppercase"
                  style={{ color: "#000000" }}
                >
                  GUEST REGISTRATION
                </MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                <MDBNavLink
                  to="#!"
                  className="text-uppercase"
                  style={{ color: "#000000" }}
                >
                  CONTACT
                </MDBNavLink>
              </MDBNavItem>
            </MDBNavbarNav> */}
            <MDBNavbarNav right>
              <MDBNavItem >
                <MDBFormInline onClick={installPWA} waves>
                  <div className="md-form my-0">
                    <span style={iconStyle} href="#contact">
                      <i className="fa fa-download font_fa_Settings mt-4"></i>
                      <br />
                      Download
                      <br />
                      Icon
                    </span>
                  </div>
                </MDBFormInline>
              </MDBNavItem>
            </MDBNavbarNav>
          </MDBCollapse>
        </MDBNavbar>
      </Router>
    </React.Fragment>
  );
}

export default NavbarComponent;
